import React from "react";
import Navbartagg from "./navbartag";
import Homee from "./Homee";
import Cart from "./Cart";
import Login from "./Login";
import { Helmet } from "react-helmet";
import { BrowserRouter, Route, Routes } from "react-router-dom";
const App = () => {
  return (
    <BrowserRouter basename="/">
      <Helmet>
        <meta charSet="utf-8" />
        <title>E com</title>
        <meta name="E com project" content="E com"></meta>
      </Helmet>
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <Login></Login>
            </div>
          }
        ></Route>
        <Route
          path="/Home"
          element={
            <>
              <Navbartagg></Navbartagg>
              <Homee></Homee>
            </>
          }
        ></Route>
        <Route
          path="/cart"
          element={
            <>
              <Navbartagg></Navbartagg>
              <Cart></Cart>
            </>
          }
        ></Route>
      </Routes>
    </BrowserRouter>
  );
};

export default App;
